import React from 'react';


function About() {
    return(
        <section id='about'>
            <h2>Hello my name is: </h2>
            <h3 class='line typing-animation'>John Vayianos</h3>
            <h3> I program some cool stuff on the internet</h3>
            <p> I am beginning my journey in my professional career as a junior web developer. I started programming when I was young messing with the terminal tryong to piece together a C program to now making fuctional websites and software. I'm looking for work with a company where I can grow and learn while providing valuable work.</p>

        </section>
    );

}

export default About;
